import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card';
import Sdata from './Sdata';
console.log(Sdata[0]);
// import Project1 from './Project1'
// import Project2 from './Project2'
// root
function ncard(val){
    return(
<Card key={val.id} imgsrc={val.imgsrc} text={val.text} title={val.title} link={val.link}/>
    );
}
ReactDOM.render(<>
<h1>List Off 5 Netflix Series</h1>
{Sdata.map(ncard)}
</>
,document.getElementById('root'));


// if else condition
const series="netflix"
const Netflix=()=>{
if (series==="netflix") {
        return(
<Card key={Sdata[1].id} 
imgsrc={Sdata[1].imgsrc} 
text={Sdata[1].text}
 title={Sdata[1].title}
  link={Sdata[1].link}/>
    );
}
}
ReactDOM.render(<>
<h1>List Of Series</h1>
<FavS/>
</>
,document.getElementById('root1'));

//end root
